import React from "react";
import "./ShippingDelivery.css"; // Optional: only if you have a CSS file

const ShippingDelivery = () => {
  return (
    <div className="shipping-delivery-page">
      <h1>Shipping & Delivery</h1>
      <p>
        Learn more about our shipping process, delivery timelines, and how you
        can track your order efficiently.
      </p>
    </div>
  );
};

export default ShippingDelivery;
